	static canDoEnclosure() {
		const node = tree.focus;
		if (!node)
			return false;
		switch (node.constructor) {
			case VerticalNode:
			case HorizontalNode:
			case EnclosureNode:
			case BasicNode:
			case OverlayNode:
			case BlankNode:
			case LostNode:
				return true;
			case LiteralNode:
				return !node.usedInOverlay() && !node.usedAsCore();
			default:
				return false;
		}
	}
